            endIcon: {
                marginLeft: 8,
            },
        },
    },
});
function usePageViews() {
    let location = useLocation()

    useEffect(
      () => {
        ga.send(['pageview', location.pathname])
      },
      [location]
    )
  }
const App: FC = () => {

     usePageViews()
     return (
        <ThemeProvider theme={theme}>
            <Layout>
            <Switch>{/* your routes here */}</Switch>
            <SnackbarProvider>
                <Wallet />

            </SnackbarProvider>
            </Layout>

        </ThemeProvider>
    );
};

export default App;
